import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import * as ReactBootStrap from "react-bootstrap";

const MainPage = () => {
  return (
    <div>
      <ReactBootStrap.Navbar bg="info" expand="lg">
        <ReactBootStrap.Navbar.Brand href="#home">
          <img
            src={"./media/logos/blrlogo.png"}
            style={{ width: "100px" }}
            alt={"Image 1"}
          ></img>
          <img
            src={"./media/logos/blrlogo2.png"}
            style={{ width: "200px" }}
            alt={"Image 2"}
          ></img>
        </ReactBootStrap.Navbar.Brand>
        <ReactBootStrap.Navbar.Toggle aria-controls="basic-navbar-nav" />
        <ReactBootStrap.Navbar.Collapse id="basic-navbar-nav">
          <ReactBootStrap.Nav className="mr-auto"></ReactBootStrap.Nav>
          <ReactBootStrap.Nav>
            <ReactBootStrap.Nav.Link href="#home">Home</ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="http://127.0.0.1:8000/contact/">
              Contact Us
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.NavDropdown
              title="Dropdown"
              id="basic-nav-dropdown"
            >
              <ReactBootStrap.NavDropdown.Item href="http://127.0.0.1:8000/login/">
                Login
              </ReactBootStrap.NavDropdown.Item>
              <ReactBootStrap.NavDropdown.Item href="http://127.0.0.1:8000/register/">
                Sign Up
              </ReactBootStrap.NavDropdown.Item>
              <ReactBootStrap.NavDropdown.Item href="https://www.bcp.gov.in/">
                More Information
              </ReactBootStrap.NavDropdown.Item>
            </ReactBootStrap.NavDropdown>
          </ReactBootStrap.Nav>
        </ReactBootStrap.Navbar.Collapse>
      </ReactBootStrap.Navbar>
    </div>
  );
};

export default MainPage;
